import Pair = require('nashorn/com/intellij/openapi/util/Pair');

declare class Couple<T> {
	static empty : Couple<T>;
	constructor(arg1 : T, arg2 : T);
	static of<T>(arg1 : T, arg2 : T) : Couple<T>;
	static getEmpty<T>() : Couple<T>;
}


declare interface Couple<T> extends Pair<T, T> {}
export = Couple
